// This is Spark Scala Code
var df = spark.read.option("header", "True").csv("abfss://filesystem-synapse-workspace@storagedatalake12321.dfs.core.windows.net/On_Time_Data_100.csv")

// # df.write.parquet('abfss://filesystem-synapse-workspace@storagedatalake12321.dfs.core.windows.net/FlightData/', mode='append')

