var duplicatedDf = { df.withColumn("_OriginState", col("OriginState")).withColumn("_DayofMonth", col("DayofMonth")) }

duplicatedDf.write.option("maxRecordsPerFile", 3000).option("mode", "overwrite").partitionBy("_OriginState", "_DayofMonth").parquet("abfss://filesystem-synapse-workspace@storagedatalake12321.dfs.core.windows.net/PartitionByOriginStateAndDayofMonthIncludingColumnNames")

// This is Spark Scala Code
var df = spark.read.option("header", "True").parquet("abfss://filesystem-synapse-workspace@storagedatalake12321.dfs.core.windows.net/PartitionByOriginStateAndDayofMonthIncludingColumnNames/_OriginState=NY")
// .where("OriginState='CA'")

display(df.select("OriginState","DestState"))
